import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import MainFeaturedPost from './MainFeaturedPost';
import FeaturedPost from './FeaturedPost';
import Footer from './Footer';

import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';


// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

export default function Blog() {
  return (
    <ThemeProvider>
      <CssBaseline />
      <Container maxWidth="lg">
        <main>
          <MainFeaturedPost />

          <MainFeaturedPost />

          <Grid container spacing={4}>
            <FeaturedPost key={"CHAVE"} />
          </Grid>

          <Grid container sx={{ mt: 4 }}>
          <FormControl>

            <FormLabel sx={{color : 'black', fontSize : '1.2rem'}}>Você tem interesse em entender as leis da física e como se aplicam no mundo ao nosso redor.</FormLabel>
            <RadioGroup 
              aria-labelledby="demo-radio-buttons-group-label"
              defaultValue="female"
              name="radio-buttons-group"
            >

              <FormControlLabel value="FISICA_-1" control={<Radio />} label="Discordo" />
              <FormControlLabel value="FISICA_0" control={<Radio />} label="Tanto faz" />
              <FormControlLabel value="FISICA_1" control={<Radio />} label="Concordo!" />

            </RadioGroup>

          </FormControl>
          </Grid>

          <Footer />
        </main>
      </Container>

    </ThemeProvider>
  );
}
